import React from 'react'

export const Welcome = () => {
    return (
        <div className='mx-5 text-center'>
            <h1>Welcome to iApplied!</h1>
            <div className='d-flex gap-3 mt-5 flex-wrap justify-content-center align-items-center'>
                <div className='col-12 col-md-3 align-self-stretch border'>Log job applications</div>
                <div className='col-12 col-md-3 align-self-stretch border'>Keep notes about each position</div>
                <div className='col-12 col-md-3 align-self-stretch border'>Stay organized while looking for a career</div>
            </div>
        </div>
    )
}
